  {a:"c",b:"v",c:"j"},

];

function App() {
  return (
    <div className="d-flex w-75">
     {
      data.map(arr=>{
        return(
          <Testa tit={arr.title} mess={arr.mess} name={arr.name}/>
        )

      })
     }
    </div>
  );
}

export default App;
